import React from "react";
import Hero from "../components/Hero";

function Home() {
  return (
    <div>
      <Hero backgroundImage="%PUBLIC_URL%/favicon.ico">
        <h1>Pupster</h1>
        <h2>They're the Good Boys and Girls</h2>
      </Hero>
    </div>
  );
}

export default Home;
